package package1;

public class If_Nestedif {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 100;
		int b = 100;
		if (a == b) {
			if (a > 20) {
				System.out.println("1");
			} else {
				System.out.println("2");
			}
		} else {
			System.out.println("3");
		}
	}

}
